script: |
  super -f text -I q8350.spq | sort > q8350.out

inputs:
  - name: q8350.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT - 7 NOT BETWEEN ( - - col0 + - col2 - - col0 * - 13 ) AND - col0 * - col2;
  - name: tab0

outputs:
  - name: q8350.out
    data: |
      15	81	47
      87	21	10
      97	1	99
